   "source": [
    "#Converting to dataframe\n",
    "\n",
    "boot_df <- data.frame(Estimate = boot_estimates, Method = \"Bootstrap\")\n",
    "jack_df <- data.frame(Estimate = theta_jack, Method = \"Jackknife\")\n",
    "\n",
    "ggplot(boot_df, aes(x = Estimate)) +\n",
    "  geom_histogram(aes(y = ..density..), bins = 30, fill = \"#66c2a5\", color = \"black\", alpha = 0.6) +\n",
    "  geom_density(color = \"#1b7837\", size = 1.2) +\n",
    "  geom_vline(xintercept = mean(boot_estimates), color = \"darkgreen\", linetype = \"dashed\", size = 1) +\n",
    "  geom_vline(xintercept = boot_ci, color = \"red\", linetype = \"dotted\", size = 1) +\n",
    "  labs(\n",
    "    title = \"Bootstrap Distribution of Mean (Cases)\",\n",
    "    x = \"Mean Estimate\",\n",
    "    y = \"Density\"\n",
    "  ) +\n",
    "  annotate(\"text\", x = boot_ci[1], y = 0, label = \"CI Lower\", vjust = -1.5, hjust = -0.2, color = \"black\") +\n",
    "  annotate(\"text\", x = boot_ci[2], y = 0, label = \"CI Upper\", vjust = -1.5, hjust = 1.2, color = \"black\") +\n",
    "  theme_minimal()"
   ]
