    "ggplot(jack_df, aes(x = Estimate)) +\n",
    "  geom_histogram(aes(y = ..density..), bins = 20, fill = \"midnightblue\", color = \"black\", alpha = 0.6) +\n",
    "  geom_density(color = \"#e34a33\", size = 1.2) +\n",
    "  geom_vline(xintercept = mean(theta_jack), color = \"darkred\", linetype = \"dashed\", size = 1) +\n",
    "  geom_vline(xintercept = jack_ci, color = \"blue\", linetype = \"dotted\", size = 1) +\n",
    "  labs(\n",
    "    title = \"Jackknife Distribution of Mean (Cases)\",\n",
    "    x = \"Mean Estimate\",\n",
    "    y = \"Density\"\n",
    "  ) +\n",
    "  annotate(\"text\", x = jack_ci[1], y = 0, label = \"CI Lower\", vjust = -1.5, hjust = -0.2, color = \"blue\") +\n",
    "  annotate(\"text\", x = jack_ci[2], y = 0, label = \"CI Upper\", vjust = -1.5, hjust = 1.2, color = \"blue\") +\n",
    "  theme_minimal()"
   ]
