    "# Comparison\n",
    "\n",
    "x <- dengue_region$Cases\n",
    "theoretical_mean <- mean(x)\n",
    "theoretical_variance <- var(x) / n  \n",
    "theoretical_se <- sd(x) / sqrt(n)\n",
    "theoretical_ci <- quantile(x, probs = c(0.025, 0.975))"
   ]
